(function($)
{
    $.fn.extend({//pass the options variable to the function
            //pass the options variable to the function
            EzyDropDownClick: function() {
                return this.each(function() {
                    var item = $(this);
                    item.siblings().removeClass('selectedItem');
                    item.addClass('selectedItem');
                    item.parents('.newDropDown.enabledDropDown').trigger('setrecord', [ this.name , true ] );
                    var dropDownList = item.parents('.dropDownList');
                    var currentpos = item.position().top;
                    if( currentpos < 0 )
                    {
                        dropDownList.scrollTop(dropDownList.scrollTop()+currentpos);
                    }
                    if( (currentpos+18) >= dropDownList.height() )
                    {
                        dropDownList.scrollTop(dropDownList.scrollTop()+(currentpos-dropDownList.height())+18 );
                    }
                    delete item;
                    delete dropDownList;
                    delete currentpos;
                });
            },
        });
})(jQuery);

