                var cursorPosition = getCursorPosition(this);
                var inputLength = this.value.length;
                switch( keynum )
                {
                    case leftKey:
                    {
                        if (cursorPosition > 0) {
                            //Do default - move cursor left one character
                            return this;
                        } else {
                            //Move focus to next left field
                            inputToFocus = $('#'+tableId+' input[rowNum='+(rowNum)+']:visible').filter(function(){
                                return $(this).attr("columnNum") < columnNum;
                            }).last();
                        }
                        break;
                    }
                    case rightKey:
                    {
                        if ((cursorPosition < inputLength) && !(cursorPosition == -1 && inputLength == 0)) {
                            //Do default - move cursor right one character
                            return this;
                        } else {
                            //Move focus to next right field
                            inputToFocus = $('#'+tableId+' input[rowNum='+(rowNum)+']:visible').filter(function(){
                               return $(this).attr("columnNum") > columnNum;
                            }).first();
                        }
                        break;
                    }
                    case upKey:
                    {
                        inputToFocus = $('#'+tableId+' input[columnNum='+(columnNum)+']:visible').filter(function(){
                           return $(this).attr("rowNum") < rowNum;
                        }).last();
                        break;
                    }
                    case downKey:
                    {
                        inputToFocus = $('#'+tableId+' input[columnNum='+(columnNum)+']:visible').filter(function(){
                           return $(this).attr("rowNum") > rowNum;
                        }).first();

                        if (!inputToFocus.length){
                            $(settings.addButtonId).find('.clickable').first().click();
                        }
